import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click on profile link using XPath
    const profileLink = await page.waitForSelector('xpath=//a[contains(text(), "Your Profile")]', { timeout: 5000 });
    await profileLink.click();

    // Wait for profile page to load and take screenshot
    await page.waitForSelector('.profile-page', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract profile information
    const profileData = await page.evaluate(() => {
      const fullName = document.querySelector('.profile-info h2')?.textContent || 'Not found';
      const username = document.querySelector('.username')?.textContent || 'Not found';
      const bio = document.querySelector('.bio')?.textContent || 'Not found';

      const stats = Array.from(document.querySelectorAll('.stat')).map(stat => {
        const number = stat.querySelector('.stat-number')?.textContent || '0';
        const label = stat.querySelector('.stat-label')?.textContent || 'Unknown';
        return { [label.toLowerCase().replace(' ', '_')]: number };
      });

      return {
        fullName,
        username,
        bio,
        stats: Object.assign({}, ...stats)
      };
    });

    // Take final screenshot with profile data
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Harvested user profile information from Amazon mock site",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
